import React, {
  Component
} from 'react';
import './TutorServices.css';
import '../TutorSchedule/TutorSchedule.css';
import {
  Link
} from 'react-router-dom';
var sessionstorage = require('sessionstorage');
import {getTutorServiceDetails} from '../StudentLogin/StudentLoginService';

export default class TutorServices extends Component {

state = {};
studentLoginService = null;

constructor(props){
  super(props);
  this.state = {
    tutorServiceDetails: []
  }
  //this.studentLoginService = new StudentLoginService();
}
  componentDidMount = () => {
    getTutorServiceDetails(sessionstorage.getItem('userId'))
      .then(response => {
        if (response !== "") {
          this.setState({
            tutorServiceDetails: response
          });
          return response;
        }
      });
  }

  render() {
    const tutorServiceDetails = this.state.tutorServiceDetails;
    const userType = sessionstorage.getItem('userType');
    return (
      <div>
    <Link  to = "/student">  <button className="btn btn-info" id ="studentdash" disabled = {userType == 'T'}>Student Dashboard</button></Link>
      <h4 id ="title">Tutor Dashboard</h4>
      <table className="table table-striped table-borderless table-hover table-card" id ="schedule">
        <thead>
          <tr className="header">
            <th>Subject Name</th>
            <th>Topic Name</th>
            <th>Category</th>
            <th>Service Type</th>
            <th>From Time</th>
            <th>To Time</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
        {tutorServiceDetails.map((value,index) => {
          return (<tr key = {index}>
            <td>{value.subjectName}</td>
            <td>{value.topicName}</td>
            <td>{value.categoryType}</td>
            <td>{value.serviceType}</td>
            <td>{value.fromTime}</td>
            <td>{value.toTime}</td>
            <td><button className="btn btn-info">Confirm</button>
            <button className="btn btn-info" id ="paybtn">Undo</button></td>
          </tr>
        )})}
        </tbody>
        </table>
      </div>

    )
  }

}
